import { LOCALES } from "../locale";

export default {
  [LOCALES.ENGLISH]: {
    "first-name": `First{name} name`,
    "last-name": "Last Name",
    "pass-word": "Password",
    "e-mail": "Email",
    "phone-number": "Phone number",
    "log-in": "Login",
    "register-": "Register",
  },
};
